import React from 'react';

function Form() {
    return(
        <div>
            <div className="col-md-3 offset-md-2">
            <button className="btn btn-light py-2">News</button>
            </div>
            <div className="col-md-3 offset-md-2">
            <button className="btn btn-light py-2">Jokes</button>
            </div>
        </div>

    );
}

export default Form;
